import React from "react";
import "./Navbar.scss";
import Logo from "./Logo";

export default function Navbar() {
  return (
    <div className="navbar">
      <div className="logo">
        <Logo />
      </div>
      <ul>
        <li className="active">Home</li>
        <li>Search</li>
        <li>Library</li>
      </ul>
      <div className="playlist">

      </div>
    </div>
  );
}
